arguments.put("fromBlock", new BlockPredicateArgument());
arguments.put("toBlock", new BlockStateArgument()); We then register our /replace command. First, we parse the arguments making sure to cast to Predicate<Block> and BlockData (and not BlockState). After that, we use a few simple for loops to find the blocks within a radius sphere from the player. In our most nested loop, we can then check if the block meets the requirements of our predicate. This is simply performed using predicate.test(block), and if satisfied, we can set the block's type. Lastly, we register our command as normal using the register() method. new CommandAPICommand("replace")
.withArguments(arguments)
.executesPlayer((player, args) -> { // Parse the arguments int radius = (int) args[0]; @SuppressWarnings("unchecked") Predicate<Block> predicate = (Predicate<Block>) args[1]; BlockData blockData = (BlockData) args[2]; // Find a (solid) sphere of blocks around the player with a given radius Location center = player.getLocation(); for (int Y = -radius; Y < radius; Y++) { for (int X = -radius; X < radius; X++) { for (int Z = -radius; Z < radius; Z++) { if (Math.sqrt((X * X) + (Y * Y) + (Z * Z)) <= radius) { Block block = center.getWorld().getBlockAt(X + center.getBlockX(), Y + center.getBlockY(), Z + center.getBlockZ()); // If that block matches a block from the predicate, set it if(predicate.test(block)) { block.setType(blockData.getMaterial()); block.setBlockData(blockData); } } } } } return;
})
.register();

